        [Test]
        public void ClawMachineCalculator_CanReadInput()
        {
            var calculator = new ClawMachineCalculator(_puzzleTestInput);

            calculator.Machines[0].ButtonAMovementX.Should().Be(94);
            calculator.Machines[0].ButtonAMovementY.Should().Be(34);
            calculator.Machines[0].ButtonBMovementX.Should().Be(22);
            calculator.Machines[0].ButtonBMovementY.Should().Be(67);
            calculator.Machines[0].PrizeX.Should().Be(8400);
            calculator.Machines[0].PrizeY.Should().Be(5400);
        }

        [Test]
        public void ClawMachineCalculator_FindMinimumTokenCost_ShouldSolveTestInput()
        {
            new ClawMachineCalculator(_puzzleTestInput).FindMinimumTokenCost().Should().Be(480);
        }

        [Test]
        public void ClawMachineCalculator_FindMinimumTokenCost_ShouldSolveInput()
        {
            new ClawMachineCalculator(_puzzleInput).FindMinimumTokenCost().Should().Be(26005);
        }

        //[Test]
        public void ClawMachineCalculator_FindMinimumTokenCost_ShouldSolveTestInputPart2()
        {
            new ClawMachineCalculator(_puzzleTestInput, true).FindMinimumTokenCost().Should().Be(480);
        }

